    return <div>
    <Head >
    <title>Terapia Gestalt: {title}</title>
        <meta name="viewport" content="width=device-width, initial-scale=1"></meta>    
    </Head>
    {children}
    <style jsx global>
    {`
    html{
        background: #E5BEE6;
    }
    `}
    </style>
    <style jsx global> 
        { `
           body{
               margin: 0px;
               font-family: system-ui;
           } 
        `}
    </style>
</div>
}

export default Layout
